package cn.moxhub.graduation.model.user;import com.baomidou.mybatisplus.annotation.IdType;import com.baomidou.mybatisplus.annotation.TableId;import com.baomidou.mybatisplus.annotation.TableName;import java.util.Objects;/** * @ClassName :User * @Description : * @Author :Mox * @Date :2023/5/3 10:16 * @Version : v1.0 **/@TableName("user")public class User {    @TableId(type = IdType.AUTO)    private Integer userId;    private String userName;    private String userPassword;    private String userAvatar;    private String userEmail;    private String userRole;    public Integer getUserId() {        return userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getUserPassword() {        return userPassword;    }    public void setUserPassword(String userPassword) {        this.userPassword = userPassword;    }    public String getUserAvatar() {        return userAvatar;    }    public void setUserAvatar(String userAvatar) {        this.userAvatar = userAvatar;    }    public String getUserEmail() {        return userEmail;    }    public void setUserEmail(String userEmail) {        this.userEmail = userEmail;    }    public String getUserRole() {        return userRole;    }    public void setUserRole(String userRole) {        this.userRole = userRole;    }    @Override    public String toString() {        return "User{" +                "userId=" + userId +                ", userName='" + userName + '\'' +                ", userPassword='" + userPassword + '\'' +                ", userAvatar='" + userAvatar + '\'' +                ", userEmail='" + userEmail + '\'' +                ", userRole='" + userRole + '\'' +                '}';    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        User user = (User) o;        return Objects.equals(userId, user.userId) &&                Objects.equals(userName, user.userName) &&                Objects.equals(userPassword, user.userPassword) &&                Objects.equals(userAvatar, user.userAvatar) &&                Objects.equals(userEmail, user.userEmail) &&                Objects.equals(userRole, user.userRole);    }    @Override    public int hashCode() {        return Objects.hash(userId, userName, userPassword, userAvatar, userEmail, userRole);    }}